import landing from './landing.svg';
import fdlogo from './fd_logo.svg';
import './App.css';
import React from "react";

function App() {

  return (
    <div className="Landing-page">

        <img src={fdlogo} className="FD-logo" alt="FranDine Company Logo"/>
        <img src={landing} className="Landing-logo" alt="Company logo"/>
        <h2>Site is under construction...</h2>

    </div>

  );
}

export default App;
